import{_ as t,o as n,c as r,a,b as i,w as o,d as e,e as l,r as c}from"./app.c1b646c2.js";const u={},d=a("h1",{id:"depannage",tabindex:"-1"},[a("a",{class:"header-anchor",href:"#depannage","aria-hidden":"true"},"#"),e(" D\xE9pannage")],-1),p=e("::: Astuce \xC9galement voir la "),h=e("Foire Aux Questions"),m=e(". :::"),f=l('<p>En cas de probl\xE8me, d\u2019abord consulter cette page. Si le probl\xE8me n\u2019est pas r\xE9f\xE9renc\xE9, ou que les instructions ne permettent pas de le r\xE9soudre, contactez l\u2019administration de votre serveur ou (signalez le probl\xE8me](./report-issue).</p><h2 id="le-client-ne-demarre-pas" tabindex="-1"><a class="header-anchor" href="#le-client-ne-demarre-pas" aria-hidden="true">#</a> Le client ne d\xE9marre pas</h2><p>Dans la plupart des cas, cela vient de votre navigateur ou syst\xE8me d\u2019exploitation qui peuvent \xEAtre obsol\xE8tes. Essayez de les mettre \xE0 jour avec les derni\xE8res versions et r\xE9essayez.</p><p>Bien que cela soit rare, si cela ne r\xE9soud pas votre probl\xE8me il est possible que cela soit \xE0 cause du cache. En quel cas, essayez de vider votre cache avant de r\xE9essayer.</p><h2 id="les-pages-ne-se-chargent-pas" tabindex="-1"><a class="header-anchor" href="#les-pages-ne-se-chargent-pas" aria-hidden="true">#</a> Les pages ne se chargent pas</h2><p>Si votre client d\xE9marre mais qu\u2019une erreur appara\xEEt lors du chargement des pages, v\xE9rifiez votre connexion internet. En parall\xE8le, v\xE9rifiez que le serveur que vous souhaitez consulter soit en ligne.</p><p>Bien que cela soit rare, si cela ne r\xE9soud pas votre probl\xE8me il est possible que cela soit \xE0 cause du cache. En quel cas, essayez de vider votre cache avant de r\xE9essayer.</p><p>Tout autre probl\xE8me vient probablement du serveur que vous cherchez \xE0 consulter, et c\u2019est son administration qu\u2019il faut contacter.</p><h2 id="le-client-est-lent" tabindex="-1"><a class="header-anchor" href="#le-client-est-lent" aria-hidden="true">#</a> Le client est lent</h2><p>Veuillez essayer de\xA0:</p><ul><li>Activer \xAB\u202FR\xE9duire les animations \xBB dans les param\xE8tres\xA0;</li><li>D\xE9sactiver \xAB\u202FEffet de flou modal\u202F\xBB dans les param\xE8tres\xA0;</li><li>Activer l\u2019acc\xE9l\xE9ration mat\xE9rielle de votre navigateur\xA0;</li><li>Utiliser un appareil plus puissant.</li></ul><h2 id="des-parties-de-l-interface-sont-etranges-ex-fond-transparent" tabindex="-1"><a class="header-anchor" href="#des-parties-de-l-interface-sont-etranges-ex-fond-transparent" aria-hidden="true">#</a> Des parties de l\u2019interface sont \xE9tranges (ex\xA0: Fond transparent)</h2><p>Une interface cass\xE9e peut \xEAtre due au cache syst\xE8me du th\xE8me lorsque l\u2019interface est modifi\xE9e suite \xE0 une mise \xE0 jour. La fonction \xAB\u202FVider le cache\u202F\xBB dans les param\xE8tres r\xE9soudra ce probl\xE8me.</p><p>::: Attention Il est ici question du cache \xAB\u202FClient\u202F\xBB, pas celui du \xAB\u202FNavigateur\u202F\xBB. :::</p><h2 id="le-clignotement-d-une-notification-ou-antenne-ne-s-arrete-pas" tabindex="-1"><a class="header-anchor" href="#le-clignotement-d-une-notification-ou-antenne-ne-s-arrete-pas" aria-hidden="true">#</a> Le clignotement d\u2019une notification ou Antenne ne s\u2019arr\xEAte pas</h2><p>Un cignotement indique du contenu non-lu. Si celui-ci persiste, cela est g\xE9n\xE9ralement d\xFB \xE0 du nouveau contenu. Si vous pensez avoir tout lu mais que le clignotement persiste, vous pouvez manuellement marquer tout le contenu comme lu dans les param\xE8tres.</p><h2 id="la-fonction-\xAB-renote-\xBB-est-bloquee" tabindex="-1"><a class="header-anchor" href="#la-fonction-\xAB-renote-\xBB-est-bloquee" aria-hidden="true">#</a> La fonction \xAB\u202FRenote\u202F\xBB est bloqu\xE9e</h2><p>Les notes adress\xE9es aux personnes abonn\xE9es uniquement ne pevent pas \xEAtre renot\xE9es.</p><h2 id="des-parties-specifiques-de-l-interface-web-misskey-ne-s-affichent-pas" tabindex="-1"><a class="header-anchor" href="#des-parties-specifiques-de-l-interface-web-misskey-ne-s-affichent-pas" aria-hidden="true">#</a> Des parties sp\xE9cifiques de l\u2019interface Web Misskey ne s\u2019affichent pas</h2><p>Ces probl\xE8mes peuvent survenir si vous utilisez un bloqueur de pub. Pour une exp\xE9rience optimale, veuillez le d\xE9sactiver.</p><h2 id="certaines-parties-de-l-intrface-web-misskey-ne-sont-pas-traduites" tabindex="-1"><a class="header-anchor" href="#certaines-parties-de-l-intrface-web-misskey-ne-sont-pas-traduites" aria-hidden="true">#</a> Certaines parties de l\u2019intrface Web Misskey ne sont pas traduites</h2><p>Dans la plupart des cas c\u2019est que la traduction n\u2019a pas encore \xE9t\xE9 faite. Merci de patientez pour qu\u2019une personne s\u2019en charge, ou <a href="./misskey">faites le</a> vous m\xEAme.</p>',22);function v(b,g){const s=c("RouterLink");return n(),r("div",null,[d,a("p",null,[p,i(s,{to:"/fr/docs/faq.html"},{default:o(()=>[h]),_:1}),m]),f])}var _=t(u,[["render",v],["__file","troubleshooting.html.vue"]]);export{_ as default};
